import React, { useState } from "react";

export const GoalMilestone = () => {

  const [goalMilestone, setGoalMilestone] = useState({});

  const newObject = {
    goalMilestone
  };

  return (
    <>
      <h1>Goal List</h1>


      <fieldset>
        <div className="form-group">
          <label htmlFor="name">Goal Milestone Check:</label>
          <input
            required
            autoFocus
            type="text"
            className="form-control"
            placeholder="Enter goal progress observations"
            onChange={(event) => {
              setGoalMilestone(event.target.checked);
            }}
          />
        </div>
      </fieldset>
    </>
  );
};
